var window = [];

/**
 * Sets the public key and encrypts the specified secret with it using RSA
 * We need to do this workaround as the VM has no network connection
 */
function encryptWithPublicKey(secret, publicKey) {
    window.crypt.setKey(publicKey);
    return window.crypt.encrypt(secret);
};

/*
 *
 *  jCryption library below (c) 2013 Daniel Griesser
 *  https://github.com/HazAT/jCryption
 *  Changed a few things to make it work in the Rhino VM and without jQuery
 *
 */

/**
* Authenticates with the server
* @param {string} AESEncryptionKey The AES key
* @param {string} publicKeyURL The public key URL
* @param {string} handshakeURL The handshake URL
* @param {function} success The function to call if the operation was successfull
* @param {function} failure The function to call if an error has occurred
*/
function authenticate(AESEncryptionKey, publicKeyURL, handshakeURL, success, failure) {
    getPublicKey(publicKeyURL, function () {
        encryptKey(AESEncryptionKey, function (encryptedKey) {
            handshake(handshakeURL, encryptedKey, function (response) {
                if (challenge(response.challenge, AESEncryptionKey)) {
                    success.call(this, AESEncryptionKey);
                } else {
                    failure.call(this);
                }
            });
        });
    });
};

/**
* Decrypts data using AES 256
* @param {string} data The data to decrypt(Ciphertext)
* @param {string} secret The AES secret
* @returns {string} The result of the decryption(Plaintext)
*/
function decrypt(data, secret) {
    return hex2string(CryptoJS.AES.decrypt(data, secret) + "");
};

/**
* Encrypts data using AES 256
* @param {string} data The data to encrypt(Plaintext)
* @param {string} secret The AES secret
* @returns {string} The result of the encryption(Ciphertext)
*/
function encrypt(data, secret) {
    return CryptoJS.AES.encrypt(data, secret) + "";
};

/**
* Makes sure that the challenge the client sent, is correct
* @param {string} challenge The challenge string
* @param {string} secret The AES secret
*/
function challenge(challenge, secret) {
    var decrypt = decrypt(challenge, secret);
    if (decrypt == secret) {
        return true;
    }
    return false;
};


/**
* Converts a hex into a string
* @param {hex} string representing a hex number
* @returns {string} ASCII sting of input hex
*/
function hex2string(hex) {
    var str = '';
    for (var i = 0; i < hex.length; i += 2) {
        str += String.fromCharCode(parseInt(hex.substr(i, 2), 16));
    }
    return str;
};

/**
* Executes a handshake with the server
* @param {string} url The url to connect to
* @param {string} ecrypted The encrypted AES secret
* @param {function} callback The function to call when the handshaking has finished
*/
function handshake(url, ecrypted, callback) {
    $.ajax({
        url: url,
        dataType: "json",
        type: "POST",
        data: {
            key: ecrypted
        },
        success: function (response) {
            callback.call(this, response);
        }
    });
};

